import React, { Fragment } from 'react';

import AppHeader from './components/AppHeader';
import Home from './components/Home';

const App = ({ classes }) => (
  <Fragment>
    <CssBaseline />
    <AppHeader />
    <Home />
  </Fragment>
);

export default App;
